import axios from 'axios'
import React from 'react'

class Photos extends React.Component {
    constructor() {
        super()
        this.state = {
            photos: []
        }
    }

    componentWillMount() {
        axios.get('http://127.0.0.1:8000/api/photos')
            .then(res => {
                console.log(res)
            })
            .catch()
    }

    render() {
        return(
            <>
                Composant photos
            </>
        )
    }
}

export default Photos
